le els elements de men arrel que es mostren com a botons.</Description><Description language-id=\"ar_SA\">          .</Description><Description language-id=\"fi_FI\">Nytt pudotusnavigointivalikon juurivalikon kohdat esitettyn painikkeina.</Description><Description language-id=\"en_US\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra un men de navegacin desplegable con elementos de men raz que se muestran como botones.</Description><Description language-id=\"nl_NL\">Geeft een rolmenu voor navigatie weer met rootmenu-items in de vorm van knoppen.</Description></root>','display',NULL,'ftl','<#if !entries?has_content>\n	<#if themeDisplay.isSignedIn()>\n		<div class=\"alert alert-info\">\n			<@liferay.language key=\"there-are-no-menu-items-to-display\" />\n		</div>\n	</#if>\n<#else>\n	<#assign\n		portletDisplay = themeDisplay.getPortletDisplay()\n\n		navbarId = \"navbar_\" + portletDisplay.getId()\n	/>\n\n	<div id=\"${navbarId}\">\n		<ul class=\"navbar-site split-button-dropdowns\">\n			<#assign navItems = entries />\n\n			<#list navItems as navItem>\n				<#assign showChildren = (displayDepth != 1) && navItem.hasBrowsableChildren() />\n\n				<#if navItem.isBrowsable() || showChildren>\n					<#assign\n						nav_item_caret = \"\"\n						nav_item_css_class = \"\"\n						nav_item_href_link = \"\"\n					/>\n\n					<#if navItem.isSelected()>\n						<#assign nav_item_css_class = \"active\" />\n					</#if>\n\n					<#if showChildren>\n						<#assign toggle_text>\n							<@liferay.language key=\"toggle\" />\n						</#assign>\n\n						<#assign nav_item_caret = \"<button aria-expanded=\'false\' aria-haspopup=\'true\' class=\'${nav_item_css_class} btn btn-secondary dropdown-toggle\' data-toggle=\'dropdown\' type=\'button\'><span class=\'caret\'></span><span class=\'sr-only\'>${toggle_text}</span></button>\" />\n					</#if>\n\n					<#if navItem.isBrowsable()>\n						<#assign nav_item_href_link = \"href=\'${navItem.getURL()}\' ${navItem.getTarget()}\" />\n					</#if>\n\n					<li>\n						<a aria-labelledby=\"layout_${portletDisplay.getId()}_${navItem.getLayoutId()}\" class=\"${nav_item_css_class} btn btn-secondary\" ${nav_item_href_link}><span>${navItem.getName()}</span></a>${nav_item_caret}\n\n						<#if showChildren>\n							<ul class=\"child-menu dropdown-menu\" role=\"menu\">\n								<#list navItem.getBrowsableChildren() as childNavigationItem>\n									<#assign\n										nav_child_css_class = \"\"\n									/>\n\n									<#if childNavigationItem.isSelected()>\n										<#assign\n											nav_child_css_class = \"active\"\n										/>\n									</#if>\n\n									<li class=\"${nav_child_css_class}\" id=\"layout_${portletDisplay.getId()}_${childNavigationItem.getLayoutId()}\" role=\"presentation\">\n										<a aria-labelledby=\"layout_${portletDisplay.getId()}_${childNavigationItem.getLayoutId()}\" href=\"${childNavigationItem.getURL()}\" ${childNavigationItem.getTarget()} role=\"menuitem\">${childNavigationItem.getName()}</a>\n									</li>\n								</#list>\n							</ul>\n						</#if>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</div>\n\n	<@liferay_aui.script use=\"liferay-navigation-interaction\">\n		var navigation = A.one(\'#${navbarId}\');\n\n		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = \'.navbar-site\';\n		Liferay.Data.NAV_LIST_SELECTOR = \'.navbar-site\';\n\n		if (navigation) {\n			navigation.plug(Liferay.NavigationInteraction);\n		}\n	</@>\n</#if>',0,0,34300,NULL,NULL),(0,0,'dd261275-f6d6-6a2f-1191-a198080ad211',34302,20123,20095,20100,NULL,20100,NULL,'2020-05-18 08:45:46.585000','2020-05-18 08:45:46.585000',20001,0,34255,'ASSET-CATEGORIES-NAVIGATION-MULTI-COLUMN-LAYOUT-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Layout med flera kolumner</Name><Name language-id=\"pt_BR\">Layout em Mltiplas Colunas</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"hu_HU\">Tbb oszlopos elrendezs</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"ar_SA\">  </Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"en_US\">Multi Column Layout</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Diseo con varias columnas</Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en kolumn fr varje ordlista. Varje kolumn inkluderar namnet p en ordlista med ordlistans toppnivkategorier listade under.</Description><Description language-id=\"pt_BR\">Exibe uma coluna para cada vocabulrio. Cada coluna inclui o nome do vocabulrio com as categorias de nvel mais alto listadas abaixo dele.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"fr_FR\">Affiche une colonne pour chaque vocabulaire. Chaque colonne inclut le nom d\'un vocabulaire avec les catgories du niveau racine listes en dessous.</Description><Description language-id=\"hu_HU\">Megjelent egy oszlopot minden sztr szmra. Minden oszlop tartalmazza a sztr nevt, alatta a sztr fels szint kategriival.</Description><Description language-id=\"de_DE\">Stellt eine Spalte fr jedes Vokabular dar. Jede Spalte enthlt den Namen eines Vokabulars mit der obersten Kategorienebene darunter.</Description><Description language-id=\"ca_ES\">Visualitza una columna per a cada vocabulari. Cada columna inclou el nom del vocabulari amb la categoria de nivell ms alta a sota.</Description><Description language-id=\"ar_SA\">   .            .</Description><Description language-id=\"fi_FI\">Nytt sarakkeen jokaiselle sanastolle. Jokainen sarake sislt sanaston nimen, miss sanaston yltason luokitukset on listattu.</Description><Description language-id=\"en_US\">Displays a column for each vocabulary. Each column includes the name of a vocabulary with the vocabulary\'s top level categories listed underneath.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Despliega una columna para cada vocabulario. Cada columna incluye el nombre de un vocabulario con las categoras de mayor nivel del vocabulario listadas debajo.</Description><Description language-id=\"nl_NL\">Toon een kolom voor ieder woordenboek. Iedere kolom bevat de naam van een woordenboek met de hoofd categorien eronder.</Description></root>','display',NULL,'ftl','<#if entries?has_content>\n	<@liferay_aui.row>\n		<#list entries as entry>\n			<@liferay_aui.col width=25>\n				<div class=\"results-header\">\n					<h3>\n						${entry.getUnambiguousTitle(entries, themeDisplay.getSiteGroupId(), themeDisplay.getLocale())}\n					</h3>\n				</div>\n\n				<#assign categories = entry.getCategories() />\n\n				<@displayCategories categories=categories />\n			</@liferay_aui.col>\n		</#list>\n	</@liferay_aui.row>\n</#if>\n\n<#macro displayCategories\n	categories\n>\n	<#if categories?has_content>\n		<ul class=\"categories\">\n			<#list categories as category>\n				<li>\n					<#assign categoryURL = renderResponse.createRenderURL() />\n\n					${categoryURL.setParameter(\"resetCur\", \"true\")}\n					${categoryURL.setParameter(\"categoryId\", category.getCategoryId()?string)}\n\n					<a href=\"${categoryURL}\">${category.getName()}</a>\n\n					<#if serviceLocator??>\n						<#assign\n							assetCategoryService = serviceLocator.findService(\"com.liferay.asset.kernel.service.AssetCategoryService\")\n\n							childCategories = assetCategoryService.getChildCategories(category.getCategoryId())\n						/>\n\n						<@displayCategories categories=childCategories />\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,0,34303,NULL,NULL),(0,0,'e446526a-5c01-3e08-d7d7-e99135ed05ad',34305,20123,20095,20100,NULL,20100,NULL,'2020-05-18 08:45:47.146000','2020-05-18 08:45:47.146000',20005,0,34255,'ASSET-TAGS-NAVIGATION-COLOR-BY-POPULARITY-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Frga efter popularitet</Name><Name language-id=\"pt_BR\">Colorir por Popularidade</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Couleur par popularit</Name><Name language-id=\"hu_HU\">Szn npszersg alapjn</Name><Name language-id=\"de_DE\">Nach Popularitt frben</Name><Name language-id=\"ca_ES\">Color per popularitat</Name><Name language-id=\"ar_SA\">  </Name><Name language-id=\"fi_FI\">Vri suosion mukaan</Name><Name language-id=\"en_US\">Color by Popularity</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Color por popularidad</Name><Name language-id=\"nl_NL\">Kleur op populariteit</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar tillgngstaggar frgade efter popularitet: rd (hg), gul (medelhg) och grn (lg).</Description><Description language-id=\"pt_BR\">Exibe marcadores coloridos por popularidade: vermelho (alta), amarelo (mdia) e verde (baixa).</Description><Description language-id=\"ja_JP\">:())</Description><Description language-id=\"fr_FR\">Affiche les tiquettes d\'asset colories par popularit: rouge (lev), jaune (moyen), et vert (bas).</Description><Description language-id=\"hu_HU\">Megjelenti a tartalom cmkket npszersg szerint sznezve: vrs (magas), srga (kzepes), s zld (alacsony).</Description><Description language-id=\"de_DE\">Schlagwrter nach Popularitt frben: Rot (hoch), gelb (mittel), grn (niedrig).</Description><Description language-id=\"ca_ES\">Mostra les etiquetes per colors segons popularitat: vermell (alta), groga (mitjana) i verda (baixa).</Description><Description language-id=\"ar_SA\">     :  ()  ()  ().</Description><Description language-id=\"fi_FI\">Nytt sislttageja, mitk on vritetty suosion mukaan: punainen (korkea), keltainen (keskiverto) ja virhe (alhainen)</Description><Description language-id=\"en_US\">Displays asset tags colored by popularity: red (high), yellow (medium), and green (low).</Description><Description language-id=\"zh_CN\">  (),  (),  ().</Description><Description language-id=\"es_ES\">Muestra las etiquetas de contenido coloreadas segn su popularidad : rojo (alta), amarilla (media) y verde (baja).</Description><Description language-id=\"nl_NL\">Toon content labels volgens populariteit: rood (hoog), geel (midden) en groen (laag).</Description></root>','display',NULL,'ftl','<#if entries?has_content>\n	<ul class=\"tag-items tag-list\">\n		<#assign\n			scopeGroupId = getterUtil.getLong(scopeGroupId, themeDisplay.getScopeGroupId())\n			classNameId = getterUtil.getLong(classNameId, 0)\n\n			maxCount = 1\n			minCount = 1\n		/>\n\n		<#list entries as entry>\n			<#assign\n				maxCount = liferay.max(maxCount, entry.getAssetCount())\n				minCount = liferay.min(minCount, entry.getAssetCount())\n			/>\n		</#list>\n\n		<#assign multiplier = 1 />\n\n		<#if maxCount != minCount>\n			<#assign multiplier = 3 / (maxCount - minCount) />\n		</#if>\n\n		<#list entries as entry>\n			<li class=\"taglib-asset-tags-summary\">\n				<#assign popularity = (maxCount - (maxCount - (entry.getAssetCount() - minCount))) * multiplier />\n\n				<#if popularity < 1>\n					<#assign color = \"green\" />\n				<#elseif (popularity >= 1) && (popularity < 2)>\n					<#assign color = \"orange\" />\n				<#else>\n					<#assign color = \"red\" />\n				</#if>\n\n				<#assign tagURL = renderResponse.createRenderURL() />\n\n				${tagURL.setParameter(\"resetCur\", \"true\")}\n				${tagURL.setParameter(\"tag\", entry.getName())}\n\n				<a class=\"tag\" href=\"${tagURL}\" style=\"color: ${color};\">\n					${entry.getName()}\n\n					<#if entry.getAssetCount()?? && getterUtil.getBoolean(showAssetCount)>\n						<span class=\"tag-asset-count\">(${entry.getAssetCount()})</span>\n					</#if>\n				</a>\n			</li>\n		</#list>\n	</ul>\n\n	<br style=\"clear: both;\" />\n</#if>',0,0,34306,NULL,NULL),(0,0,'15d48b24-0987-9125-3bb0-4b85f0ef3118',34308,20123,20095,20100,NULL,20100,NULL,'2020-05-18 08:45:47.840000','2020-05-18 08:45:47.840000',20045,0,34255,'SITE-MAP-MULTI-COLUMN-LAYOUT-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Layout med flera kolumner</Name><Name language-id=\"pt_BR\">Layout em Mltiplas Colunas</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"hu_HU\">Tbb oszlopos elrendezs</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"ar_SA\">  </Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"en_US\">Multi Column Layout</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Diseo con varias columnas</Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en kolumn fr varje sida p den hgsta nivn. Varje kolumn inkluderar namnet p varje sida p den hgsta nivn samt sidans omedelbara underordnade element listade under den.</Description><Description language-id=\"pt_BR\">Exibe uma coluna para cada pgina de nvel superior. Cada coluna inclui o nome de uma pgina de nvel superior com os filhos imediatos da pgina listados abaixo.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"fr_FR\">Affiche une colonne pour chaque page de niveau suprieur. Chaque colonne comprend le nom d\'une page de niveau suprieur avec les enfants immdiats indiqus en-dessous.</Description><Description language-id=\"hu_HU\">Megjelent egy oszlopot minden fels szint oldalhoz. Mindegyik oszlop tartalmazza a legfels szint oldal nevt, alatta az oldal kzvetlen utdjval.</Description><Description language-id=\"de_DE\">Zeigt eine Spalte fr jede Seite der obersten Ebene. Jede Spalte enthlt den Namen einer Seite der obersten Ebene, darunter werden die direkten Unterseiten aufgelistet.</Description><Description language-id=\"ca_ES\">Mostra una columna per cada pgina de nivell superior. A cada columna, s\'hi inclou el nom d\'una pgina de nivell superior amb el fill immediat de la pgina en una llista a la part inferior.</Description><Description language-id=\"ar_SA\">     .            .</Description><Description language-id=\"fi_FI\">Nytt sarakkeen jokaiselle yltason sivulle. Jokainen sarake sislt yltason sivun nimen ja sivun vlittmt alasivut lueteltuna alapuolella.</Description><Description language-id=\"en_US\">Displays a column for each top level page. Each column includes the name of a top level page with the page\'s immediate children listed underneath.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra una columna por cada pgina de nivel superior. En cada columna, se incluye el nombre de una pgina de nivel superior con el elemento secundario inmediato de la pgina en una lista de la parte inferior.</Description><Description language-id=\"nl_NL\">Geeft een kolom weer voor elke pagina op het hoogste niveau. Elke kolom bevat de naam van een bovenliggende pagina met alle directe onderliggende pagina\'s eronder.</Description></root>','display',NULL,'ftl','<#if entries?has_content>\n	<@liferay_aui.row>\n		<#list entries as entry>\n			<#if layoutPermission.containsWithoutViewableGroup(permissionChecker, entry, \"VIEW\")>\n				<@liferay_aui.col width=25>\n					<div class=\"results-header\">\n						<h3>\n							<a\n\n							<#assign layoutType = entry.getLayoutType() />\n\n							<#if layoutType.isBrowsable()>\n								href=\"${portalUtil.getLayoutURL(entry, themeDisplay)}\"\n							</#if>\n\n							>${entry.getName(locale)}</a>\n						</h3>\n					</div>\n\n					<@displayPages\n						depth=1\n						pages=entry.getChildren(permissionChecker)\n					/>\n				</@liferay_aui.col>\n			</#if>\n		</#list>\n	</@liferay_aui.row>\n</#if>\n\n<#macro displayPages\n	depth\n	pages\n>\n	<#if pages?has_content && ((depth < displayDepth?number) || (displayDepth?number == 0))>\n		<ul class=\"child-pages\">\n			<#list pages as page>\n				<li>\n					<a\n\n					<#assign pageType = page.getLayoutType() />\n\n					<#if pageType.isBrowsable()>\n						href=\"${portalUtil.getLayoutURL(page, themeDisplay)}\"\n					</#if>\n\n					>${page.getName(locale)}</a>\n\n					<@displayPages\n						depth=depth + 1\n						pages=page.getChildren(permissionChecker)\n					/>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,0,34309,NULL,NULL),(0,0,'ad98d6a9-2626-59a9-11ef-5c1b0c2a33e1',34311,20123,20095,20100,NULL,20100,NULL,'2020-05-18 08:45:48.410000','2020-05-18 08:45:48.410000',30001,0,34255,'BLOGS-BASIC-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Standard</Name><Name language-id=\"pt_BR\">Bsico</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Basique</Name><Name language-id=\"hu_HU\">Egyszer</Name><Name language-id=\"de_DE\">Einfach</Name><Name language-id=\"ca_ES\">Bsic</Name><Name l