mb-arrows li:nth-child(n+2) a::before {\n				border-left-color: #F5F7F8;\n			}\n		</style>\n	</@>\n\n	<div class=\"breadcrumb breadcrumb-arrows\">\n		<#assign cssClass = \"\" />\n\n		<#list entries as entry>\n			<#if entry?is_last>\n				<#assign cssClass = \"active\" />\n			</#if>\n\n			<li class=\"${cssClass}\" <#if entry?is_last>aria-current=\"page\"</#if>>\n				<#if entry?has_next>\n					<a\n\n					<#if entry.isBrowsable()>\n						href=\"${entry.getURL()!\"\"}\"\n					</#if>\n\n					>\n				</#if>\n\n				<div class=\"entry\">\n					${htmlUtil.escape(entry.getTitle())}\n				</div>\n\n				<#if entry?has_next>\n					</a>\n				</#if>\n			</li>\n		</#list>\n	</div>\n</#if>',0,0,34329,NULL,NULL),(0,0,'d9b772ef-2c60-68ae-a0d6-12be4341a471',34331,20123,20095,20100,NULL,20100,NULL,'2020-05-18 08:45:53.037000','2020-05-18 08:45:53.037000',34327,0,34255,'BREADCRUMB-HORIZONTAL-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Horisontell</Name><Name language-id=\"pt_BR\">Horizontal</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Horizontal(e)</Name><Name language-id=\"hu_HU\">Vzszintes</Name><Name language-id=\"de_DE\">Horizontal</Name><Name language-id=\"ca_ES\">Horitzontal</Name><Name language-id=\"ar_SA\"></Name><Name language-id=\"fi_FI\">Vaakasuuntainen</Name><Name language-id=\"en_US\">Horizontal</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Horizontal</Name><Name language-id=\"nl_NL\">Horizontaal</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en lnkstig horisontellt.</Description><Description language-id=\"pt_BR\">Exibe um caminho de navegao horizontalmente.</Description><Description la