 otsikot, tekijt ja abstraktit kytten kortteja blogientryille.</Description><Description language-id=\"en_US\">Display cover images, titles, authors and abstracts using cards for blog entries.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra imgenes de portada, ttulos, autores y abstractos con tarjetas de entradas de blog.</Description><Description language-id=\"nl_NL\">Toon cover-afbeeldingen, titels, auteurs en samenvattingen m. b. v. kaarten voor blogberichten.</Description></root>','ftl','<div class=\"row widget-mode-card\">\n	<#if entries?has_content>\n		<#list entries as curBlogEntry>\n			<#if curBlogEntry.getCoverImageURL(themeDisplay)??>\n				<#assign cardImage = true />\n			<#else>\n				<#assign cardImage = false />\n			</#if>\n\n			<div class=\"col-lg-4\">\n				<div class=\"card\">\n					<#if cardImage>\n						<div class=\"card-header\">\n							<div class=\"aspect-ratio aspect-ratio-8-to-3\">\n								<img alt=\"thumbnail\" class=\"aspect-ratio-item-center-middle aspect-ratio-item-fluid\" src=\"${curBlogEntry.getCoverImageURL(themeDisplay)}\">\n							</div>\n						</div>\n					</#if>\n\n					<div class=\"card-body widget-topbar\">\n						<div class=\"autofit-row card-title\">\n							<div class=\"autofit-col autofit-col-expand\">\n								<#assign viewEntryPortletURL = renderResponse.createRenderURL() />\n\n								${viewEntryPortletURL.setParameter(\"mvcRenderCommandName\", \"/blogs/view_entry\")}\n\n								<#if validator.isNotNull(curBlogEntry.getUrlTitle())>\n									${viewEntryPortletURL.setParameter(\"urlTitle\", curBlogEntry.getUrlTitle())}\n								<#else>\n									${viewEntryPortletURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n								</#if>\n\n								<h3 class=\"title\">\n									<a class=\"title-link\" href=\"${viewEntryPortletURL.toString()}\">\n									${htmlUtil.escape(blogsEntryUtil.getDisplayTitle(resourceBundle, curBlogEntry))}</a>\n								</h3>\n							</div>\n\n							<div class=\"autofit-col visible-interaction\">\n								<div class=\"dropdown dropdown-action\">\n									<@liferay_ui[\"icon-menu\"]\n										direction=\"left-side\"\n										icon=\"\"\n										markupView=\"lexicon\"\n										message=\"actions\"\n										showWhenSingleIcon=true\n									>\n										<#if blogsEntryPermission.contains(permissionChecker, curBlogEntry, \"UPDATE\")>\n											<#assign editEntryPortletURL = renderResponse.createRenderURL() />\n\n											${editEntryPortletURL.setWindowState(windowStateFactory.getWindowState(\"MAXIMIZED\"))}\n											${editEntryPortletURL.setParameter(\"mvcRenderCommandName\", \"/blogs/edit_entry\")}\n											${editEntryPortletURL.setParameter(\"redirect\", currentURL)}\n											${editEntryPortletURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n\n											<@liferay_ui[\"icon\"]\n												label=true\n												message=\"edit\"\n												url=editEntryPortletURL.toString()\n											/>\n										</#if>\n										<#if blogsEntryPermission.contains(permissionChecker, curBlogEntry, \"PERMISSIONS\")>\n											<#assign permissionsEntryURL = permissionsURLTag.doTag(null, \"com.liferay.blogs.model.BlogsEntry\", blogsEntryUtil.getDisplayTitle(resourceBundle, curBlogEntry), curBlogEntry.getGroupId()?string, curBlogEntry.getEntryId()?string, windowStateFactory.getWindowState(\"POP_UP\").toString(), null, request) />\n\n											<@liferay_ui[\"icon\"]\n												label=true\n												message=\"permissions\"\n												method=\"get\"\n												url=permissionsEntryURL\n												useDialog=true\n											/>\n										</#if>\n										<#if blogsEntryPermission.contains(permissionChecker, curBlogEntry, \"DELETE\")>\n											<#assign deleteEntryPortletURL = renderResponse.createActionURL() />\n\n											${deleteEntryPortletURL.setParameter(\"javax.portlet.action\", \"/blogs/edit_entry\")}\n											${deleteEntryPortletURL.setParameter(\"cmd\", trashHelper.isTrashEnabled(themeDisplay.getScopeGroupId())?then(\"move_to_trash\", \"delete\"))}\n											${deleteEntryPortletURL.setParameter(\"redirect\", currentURL)}\n											${deleteEntryPortletURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n\n											<@liferay_ui[\"icon-delete\"]\n												label=true\n												trash=trashHelper.isTrashEnabled(themeDisplay.getScopeGroupId())\n												url=deleteEntryPortletURL.toString()\n											/>\n										</#if>\n									</@>\n								</div>\n							</div>\n						</div>\n\n						<div class=\"autofit-row widget-metadata\">\n							<div class=\"autofit-col inline-item-before\">\n								<@liferay_ui[\"user-portrait\"]\n									size=\"lg\"\n									userId=curBlogEntry.userId\n									userName=curBlogEntry.userName\n								/>\n							</div>\n\n							<div class=\"autofit-col autofit-col-expand\">\n								<div class=\"autofit-row\">\n									<div class=\"autofit-col autofit-col-expand\">\n										<#if serviceLocator??>\n											<#assign\n												userLocalService = serviceLocator.findService(\"com.liferay.portal.kernel.service.UserLocalService\")\n\n												entryUser = userLocalService.fetchUser(curBlogEntry.getUserId())\n											/>\n\n											<#if entryUser?? && !entryUser.isDefaultUser()>\n												<#assign entryUserURL = entryUser.getDisplayURL(themeDisplay) />\n											</#if>\n										</#if>\n\n										<div class=\"text-truncate-inline\">\n											<a href=\"${(entryUserURL?? && validator.isNotNull(entryUserURL))?then(entryUserURL, \"\")}\" class=\"text-truncate username\">${curBlogEntry.getUserName()}</a>\n										</div>\n\n										<div>\n											${dateUtil.getDate(curBlogEntry.getStatusDate(), \"dd MMM\", locale)}\n\n											<#if blogsPortletInstanceConfiguration.enableReadingTime()>\n												- <@liferay_reading_time[\"reading-time\"] displayStyle=\"simple\" model=curBlogEntry />\n											</#if>\n\n											<#if serviceLocator??>\n												<#assign\n													assetEntryLocalService = serviceLocator.findService(\"com.liferay.asset.kernel.service.AssetEntryLocalService\")\n\n													assetEntry = assetEntryLocalService.getEntry(\"com.liferay.blogs.model.BlogsEntry\", curBlogEntry.getEntryId())\n												/>\n\n												<#if blogsPortletInstanceConfiguration.enableViewCount()>\n													- <@liferay_ui[\"message\"] arguments=assetEntry.getViewCount() key=(assetEntry.getViewCount()==0)?then(\"x-view\", \"x-views\") />\n												</#if>\n											</#if>\n										</div>\n									</div>\n								</div>\n							</div>\n						</div>\n\n						<#if validator.isNotNull(curBlogEntry.getDescription())>\n							<#assign content = curBlogEntry.getDescription() />\n						<#else>\n							<#assign content = curBlogEntry.getContent() />\n						</#if>\n\n						<#if cardImage>\n							<p class=\"widget-resume\">${stringUtil.shorten(htmlUtil.stripHtml(content), 150)}</p>\n						<#else>\n							<p class=\"widget-resume\">${stringUtil.shorten(htmlUtil.stripHtml(content), 400)}</p>\n						</#if>\n					</div>\n\n					<div class=\"card-footer\">\n						<div class=\"card-row\">\n							<div class=\"autofit-float autofit-row autofit-row-center widget-toolbar\">\n								<#if blogsPortletInstanceConfiguration.enableComments()>\n									<div class=\"autofit-col\">\n										<#assign viewCommentsPortletURL = renderResponse.createRenderURL() />\n\n										${viewCommentsPortletURL.setParameter(\"mvcRenderCommandName\", \"/blogs/view_entry\")}\n										${viewCommentsPortletURL.setParameter(\"scroll\", renderResponse.getNamespace() + \"discussionContainer\")}\n\n										<#if validator.isNotNull(curBlogEntry.getUrlTitle())>\n											${viewCommentsPortletURL.setParameter(\"urlTitle\", curBlogEntry.getUrlTitle())}\n										<#else>\n											${viewCommentsPortletURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n										</#if>\n\n										<a class=\"btn btn-outline-borderless btn-outline-secondary btn-sm\" href=\"${viewCommentsPortletURL.toString()}\" title=\"${language.get(locale, \"comments\")}\">\n											<span class=\"inline-item inline-item-before\">\n												<@clay[\"icon\"] symbol=\"comments\" />\n											</span> ${commentManager.getCommentsCount(\"com.liferay.blogs.model.BlogsEntry\", curBlogEntry.getEntryId())}\n										</a>\n									</div>\n								</#if>\n\n								<#if blogsPortletInstanceConfiguration.enableRatings()>\n									<div class=\"autofit-col\">\n										<@liferay_ui[\"ratings\"]\n											className=\"com.liferay.blogs.model.BlogsEntry\"\n											classPK=curBlogEntry.getEntryId()\n										/>\n									</div>\n								</#if>\n\n								<div class=\"autofit-col autofit-col-end\">\n									<#assign bookmarkURL = renderResponse.createRenderURL() />\n\n									${bookmarkURL.setWindowState(windowStateFactory.getWindowState(\"NORMAL\"))}\n									${bookmarkURL.setParameter(\"mvcRenderCommandName\", \"/blogs/view_entry\")}\n\n									<#if validator.isNotNull(curBlogEntry.getUrlTitle())>\n										${bookmarkURL.setParameter(\"urlTitle\", curBlogEntry.getUrlTitle())}\n									<#else>\n										${bookmarkURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n									</#if>\n\n									<@liferay_social_bookmarks[\"bookmarks\"]\n										className=\"com.liferay.blogs.model.BlogsEntry\"\n										classPK=curBlogEntry.getEntryId()\n										maxInlineItems=0\n										target=\"_blank\"\n										title=blogsEntryUtil.getDisplayTitle(resourceBundle, curBlogEntry)\n										types=blogsPortletInstanceConfiguration.socialBookmarksTypes()\n										url=portalUtil.getCanonicalURL(bookmarkURL.toString(), themeDisplay, themeDisplay.getLayout())\n									/>\n								</div>\n							</div>\n						</div>\n					</div>\n				</div>\n			</div>\n		</#list>\n	</#if>\n</div>',0,20100,NULL,'2020-05-18 08:45:49.020000'),(0,0,34320,20123,20095,20100,NULL,'2020-05-18 08:45:50.691000',34317,0,34318,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Kompakt layout</Name><Name language-id=\"pt_BR\">Layout Compacto</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Disposition compacte</Name><Name language-id=\"hu_HU\">Kompakt elrendezs</Name><Name language-id=\"de_DE\">Kompaktes Layout</Name><Name language-id=\"ca_ES\">Disposici compacta</Name><Name language-id=\"ar_SA\"> </Name><Name language-id=\"fi_FI\">Tiivis Asettelu</Name><Name language-id=\"en_US\">Compact Layout</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Compact Layout</Name><Name language-id=\"nl_NL\">Compacte lay-out</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">portlet-display-template-description-compact</Description><Description language-id=\"pt_BR\">portlet-display-template-description-compact</Description><Description language-id=\"ja_JP\">portlet-display-template-description-compact</Description><Description language-id=\"fr_FR\">portlet-display-template-description-compact</Description><Description language-id=\"hu_HU\">portlet-display-template-description-compact</Description><Description language-id=\"de_DE\">portlet-display-template-description-compact</Description><Description language-id=\"ca_ES\">portlet-display-template-description-compact</Description><Description language-id=\"ar_SA\">portlet-display-template-description-compact</Description><Description language-id=\"fi_FI\">portlet-display-template-description-compact</Description><Description language-id=\"en_US\">portlet-display-template-description-compact</Description><Description language-id=\"zh_CN\">portlet-display-template-description-compact</Description><Description language-id=\"es_ES\">portlet-display-template-description-compact</Description><Description language-id=\"nl_NL\">portlet-display-template-description-compact</Description></root>','ftl','<div class=\"search-total-label\">\n	${languageUtil.format(locale, \"x-results-for-x\", [searchContainer.getTotal(), \"<strong>\" + htmlUtil.escape(searchResultsPortletDisplayContext.getKeywords()) + \"</strong>\"], false)}\n</div>\n\n<div class=\"display-compact\">\n	<ul>\n		<#if entries?has_content>\n			<#list entries as entry>\n				<#if !entry.isTemporarilyUnavailable()>\n					<li>\n						<a class=\"link-primary single-link\" href=\"${entry.getViewURL()}\">\n							${entry.getHighlightedTitle()}\n						</a>\n					</li>\n				</#if>\n			</#list>\n		</#if>\n	</ul>\n</div>',0,20100,NULL,'2020-05-18 08:45:50.691000'),(0,0,34323,20123,20095,20100,NULL,'2020-05-18 08:45:51.112000',34317,0,34321,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Listlayout</Name><Name language-id=\"pt_BR\">Layout da Lista</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Disposition en liste</Name><Name language-id=\"hu_HU\">Lista elrendezs</Name><Name language-id=\"de_DE\">Listenlayout</Name><Name language-id=\"ca_ES\">Disposici de la llista</Name><Name language-id=\"ar_SA\"> </Name><Name language-id=\"fi_FI\">Luetteloasettelu</Name><Name language-id=\"en_US\">List Layout</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">List Layout</Name><Name language-id=\"nl_NL\">Lijstlay-out</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">portlet-display-template-description-list</Description><Description language-id=\"pt_BR\">portlet-display-template-description-list</Description><Description language-id=\"ja_JP\">portlet-display-template-description-list</Description><Description language-id=\"fr_FR\">portlet-display-template-description-list</Description><Description language-id=\"hu_HU\">portlet-display-template-description-list</Description><Description language-id=\"de_DE\">portlet-display-template-description-list</Description><Description language-id=\"ca_ES\">portlet-display-template-description-list</Description><Description language-id=\"ar_SA\">portlet-display-template-description-list</Description><Description language-id=\"fi_FI\">portlet-display-template-description-list</Description><Description language-id=\"en_US\">portlet-display-template-description-list</Description><Description language-id=\"zh_CN\">portlet-display-template-description-list</Description><Description language-id=\"es_ES\">portlet-display-template-description-list</Description><Description language-id=\"nl_NL\">portlet-display-template-description-list</Description></root>','ftl','<div class=\"search-total-label\">\n	${languageUtil.format(locale, \"x-results-for-x\", [searchContainer.getTotal(), \"<strong>\" + htmlUtil.escape(searchResultsPortletDisplayContext.getKeywords()) + \"</strong>\"], false)}\n</div>\n\n<div class=\"display-list\">\n	<ul class=\"list-group\" id=\"search-results-display-list\">\n		<#if entries?has_content>\n			<#list entries as entry>\n				<li class=\"list-group-item list-group-item-flex\">\n					<#if !entry.isTemporarilyUnavailable()>\n						<div class=\"autofit-col\">\n							<#if entry.isUserPortraitVisible()>\n								<@liferay_ui[\"user-portrait\"] userId=entry.getAssetEntryUserId() />\n							</#if>\n\n							<#if entry.isThumbnailVisible()>\n								<img alt=\"${languageUtil.get(locale, \"thumbnail\")}\" class=\"img-rounded search-result-thumbnail-img\" src=\"${entry.getThumbnailURLString()}\" />\n							</#if>\n\n							<#if entry.isIconVisible()>\n								<span class=\"search-asset-type-sticker sticker sticker-rounded sticker-secondary sticker-static\">\n									<@clay.icon symbol=\"${entry.getIconId()}\" />\n								</span>\n							</#if>\n						</div>\n\n						<div class=\"autofit-col autofit-col-expand\">\n							<section class=\"autofit-section\">\n								<div class=\"list-group-title\">\n									<a href=\"${entry.getViewURL()}\">\n										${entry.getHighlightedTitle()}\n									</a>\n								</div>\n\n								<div class=\"search-results-metadata\">\n									<p class=\"list-group-subtext\">\n										<#if entry.isModelResourceVisible()>\n											<span class=\"subtext-item\">\n												<strong>${entry.getModelResource()}</strong>\n											</span>\n										</#if>\n\n										<#if entry.isLocaleReminderVisible()>\n											<@liferay_ui[\"icon\"]\n												icon=\"../language/${entry.getLocaleLanguageId()}\"\n												message=entry.getLocaleReminder()\n											/>\n										</#if>\n\n										<#if entry.isCreatorVisible()>\n											<span class=\"subtext-item\">\n												&#183;\n\n												<@liferay.language key=\"written-by\" />\n\n												<strong>${htmlUtil.escape(entry.getCreatorUserName())}</strong>\n											</span>\n										</#if>\n\n										<#if entry.isCreationDateVisible()>\n											<span class=\"subtext-item\">\n												<@liferay.language key=\"on-date\" />\n\n												${entry.getCreationDateString()}\n											</span>\n										</#if>\n									</p>\n\n									<#if entry.isContentVisible()>\n										<p class=\"list-group-subtext\">\n											<span class=\"subtext-item\">\n												${entry.getContent()}\n											</span>\n										</p>\n									</#if>\n\n									<#if entry.isFieldsVisible()>\n										<p class=\"list-group-subtext\">\n											<#assign separate = false />\n\n											<#list entry.getFieldDisplayContexts() as fieldDisplayContext>\n												<#if separate>\n													&#183;\n												</#if>\n\n												<span class=\"badge\">${fieldDisplayContext.getName()}</span>\n\n												<span>${fieldDisplayContext.getValuesToString()}</span>\n\n												<#assign separate = true />\n											</#list>\n										</p>\n									</#if>\n\n									<#if entry.isAssetCategoriesOrTagsVisible()>\n										<h6 class=\"search-document-tags text-default\">\n											<@liferay_asset[\"asset-tags-summary\"]\n												className=entry.getClassName()\n												classPK=entry.getClassPK()\n												paramName=entry.getFieldAssetTagNames()\n												portletURL=entry.getPortletURL()\n											/>\n\n											<@liferay_asset[\"asset-categories-summary\"]\n												className=entry.getClassName()\n												classPK=entry.getClassPK()\n												paramName=entry.getFieldAssetCategoryIds()\n												portletURL=entry.getPortletURL()\n											/>\n										</h6>\n									</#if>\n\n									<#if entry.isDocumentFormVisible()>\n										<h6 class=\"expand-details text-default\">\n											<span class=\"list-group-text\" style=\"\">\n												<a href=\"javascript:;\">\n													<@liferay.language key=\"details\" />...\n												</a>\n											</span>\n										</h6>\n\n										<div class=\"hide search-results-list table-details table-responsive\">\n											<table class=\"table\">\n												<thead>\n													<tr>\n														<th class=\"key-column\">\n															<@liferay.language key=\"key\" />\n														</th>\n														<th>\n															<@liferay.language key=\"value\" />\n														</th>\n													</tr>\n												</thead>\n\n												<tbody>\n													<#list entry.getDocumentFormFieldDisplayContexts() as fieldDisplayContext>\n														<tr>\n															<td class=\"key-column table-details-content\">\n																<strong>${htmlUtil.escape(fieldDisplayContext.getName())}</strong>\n															</td>\n															<td class=\"table-details-content\">\n																<code>\n																	${fieldDisplayContext.getValuesToString()}\n																</code>\n															</td>\n														</tr>\n													</#list>\n												</tbody>\n											</table>\n										</div>\n									</#if>\n								</div>\n							</section>\n						</div>\n					<#else>\n						<div class=\"autofit-col\">\n							<div class=\"alert alert-danger\">\n								<@liferay.language_format\n									arguments=\"result\"\n									key=\"is-temporarily-unavailable\"\n								/>\n							</div>\n						</div>\n					</#if>\n				</li>\n			</#list>\n		</#if>\n	</ul>\n</div>\n\n<@liferay_aui.script use=\"aui-base\">\n	A.one(\'#search-results-display-list\').delegate(\n		\'click\',\n		function(event) {\n			var currentTarget = event.currentTarget;\n\n			currentTarget.siblings(\'.search-results-list\').toggleClass(\'hide\');\n		},\n		\'.expand-details\'\n	);\n</@liferay_aui.script>',0,20100,NULL,'2020-05-18 08:45:51.112000'),(0,0,34326,20123,20095,20100,NULL,'2020-05-18 08:45:51.536000',34317,0,34324,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Kortlayout</Name><Name language-id=\"pt_BR\">Layout do Carto</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Disposition de la carte</Name><Name language-id=\"hu_HU\">Krtyaelrendezs</Name><Name language-id=\"de_DE\">Kartenlayout</Name><Name language-id=\"ca_ES\">Disposici de la targeta</Name><Name language-id=\"ar_SA\"> </Name><Name language-id=\"fi_FI\">Kortin Asettelu</Name><Name language-id=\"en_US\">Card Layout</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Card Layout</Name><Name language-id=\"nl_NL\">Kaartlay-out</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa omslagsbilder, ru