djn egytt a tagokkal az ezen az oldalon tallhat wiki-n keresztl. Fedezzen fel kapcsold tartalmat cmkkkel, s navigljon gyorsan s knnyen kategrikkal.</Description><Description language-id=\"de_DE\">Arbeiten Sie mit Hilfe des Wikis dieser Seite mit anderen Mitgliedern zusammen. Entdecken Sie in Verbindung stehende Inhalte ber Tags und navigieren Sie schnell und einfach mit Kategorien.</Description><Description language-id=\"ca_ES\">Collabora amb els membres a travs de la wiki en aquesta pgina. Descobreix el contingut relacionat a travs d\'etiquetes i navega d\'una forma rpida i fcil amb les categories.</Description><Description language-id=\"ar_SA\">        .            .</Description><Description language-id=\"fi_FI\">Tee yhteistyt jsenten kanssa wikin kautta tll sivulla. Tutustu aiheeseen liittyvn sisltn tunnisteiden kautta ja siirry helposti ja nopeasti luokkien vlill.</Description><Description language-id=\"en_US\">Collaborate with members through the wiki on this page. Discover related content through tags, and navigate quickly and easily with categories.</Description><Description language-id=\"zh_CN\">Wiki</Description><Description language-id=\"es_ES\">Colabora con los miembros a travs de la wiki en esta pgina. Descubre el contenido relacionado a travs de etiquetas y navega rpida y fcilmente por las categoras.</Description><Description language-id=\"nl_NL\">Werk samen met leden via de wiki op deze pagina. Ontdek verwante inhoud via tags en navigeer snel en eenvoudig met behulp van categorien.</Description></root>',NULL,1),(0,'6788d591-5bef-a417-d03e-84b995453625',34517,20095,20100,NULL,'2020-05-18 08:46:41.937000','2020-05-18 08:46:41.937000','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Blogg</Name><Name language-id=\"pt_BR\">Blog</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"fr_FR\">Blogue</Name><Name language-id=\"hu_HU\">Blog</Name><Name language-id=\"de_DE\">Blog</Name><Name language-id=\"ca_ES\">Bloc</Name><Name language-id=\"ar_SA\"></Name><Name language-id=\"fi_FI\">Blogit</Name><Name language-id=\"en_US\">Blog</Name><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Blog</Name><Name language-id=\"nl_NL\">Blog</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Skapa, redigera och visa bloggar frn den hr sidan. Utforska mnen genom att anvnda taggar och f kontakt med andra medlemmar som bloggar.</Description><Description language-id=\"pt_BR\">Crie, edite e visualize blogs a partir desta pgina. Explore tpicos utilizando tags e conecte-se a outros membros deste blog.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"fr_FR\">Crer, diter et visualiser les blogs de cette page. Explorer les sujets en utilisant des tags et se connecter  d\'autres membres de ce blog.</Description><Description language-id=\"hu_HU\">Hozz ltre, szerkessz s tekints meg blogokat errl az oldalrl. Fedezd fel a tmkat a cmkk segtsgvel s lpj kapcsolatba a tbbi blog taggal.</Description><Description language-id=\"de_DE\">Erstellen, bearbeiten und ansehen von Blogs dieser Seite. Erkunden Sie Themen mit Hilfe von Tags und verbinden Sie sich mit anderen Mitgliedern, die bloggen.</Description><Description language-id=\"ca_ES\">Crear, editar i veure els blogs d\'aquesta pgina. Explorar temes fent s de les etiquetes i connectar-se amb altres membres d\'aquest blog.</Description><Description language-id=\"ar_SA\">       .         .</Description><Description language-id=\"fi_FI\">Luo, muokkaa ja nyt tmn sivun blogit. Selaa aiheita kytmll tunnisteita ja tutustu muihin tmn blogin kirjoittajiin.</Description><Description language-id=\"en_US\">Create, edit, and view blogs from this page. Explore topics using tags, and connect with other members that blog.</Description><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Cree, edite y vea blogs desde esta pgina. Explore los temas usando etiquetas y conecte con otros miembros del blog.</Description><Description language-id=\"nl_NL\">Vanaf deze pagina kunt u blogs aanmaken, bewerken en bekijken. Ontdek onderwerpen aan de hand van tags, en verbind met andere leden die bloggen.</Description></root>',NULL,1);
